use SHOPFIGURE2
go
 create trigger AddProduct
 on Products
 for insert
 as begin 
	update Categories
	set Categories.Number=Categories.Number+inserted.Number
	from Categories join inserted
	on Categories.IDCategory=inserted.IDCategory
	end
go 
create trigger DeleteProduct
on Products
for delete
as begin 
	update Categories
	set Categories.Number=Categories.Number-deleted.Number
	from Categories join deleted
	on Categories.IDCategory=deleted.IDCategory
	end
go
create trigger OrderProduct
on OrderDetails
for insert
as begin
	update Products
	set Products.Number=Products.Number-inserted.Number
	from Products join inserted
	on Products.IDProduct=inserted.IDProduct
	end

